    <title>UFO Performance Tracker</title>
    <style>
      .variant {
        border-left: 1px solid lightgray;
        padding-left: 2rem;
      }
      th,
      td {
        text-align: left;
        padding: 0.1rem 1rem 0.1rem 0;
      }
      .time {
        text-align: right;
        font-family: monospace;
      }
      .backdrop {
        background-color: rgba(0, 0, 0, 0.3);
        position: fixed;
        display: flex;
        top: 0;
        left: 0;
        width: 100vw;
        height: 100vh;
      }
      .modal {
        background-color: white;
        border: 1px solid black;
        margin: auto auto;
        padding: 1rem;
        max-width: calc(100vw - 6rem - 2px);
        max-height: calc(100vh - 6rem - 2px);
        overflow: auto;
      }
      [v-cloak] {
        display: none;
      }
    </style>
  </head>
  <body>

        <div class="variant" v-for="(projects, variant_id) in variants">

          <table>
            <tr>

              <th>Version</th>
              <th>Clock time (ms)</th>
              <th>CPU time (ms)</th>
              <th></th>
            </tr>

                  <th>{{version_id}}</th>
                  <td class="time">{{time(result.clock_time_ms)}}</td>
                  <td class="time">{{time(result.cpu_time_ms)}}</td>
                  <td>
                    <button @click="alert(result.cmd, result.output)">
                      show logs
                    </button>
                  </td>
                </tr>
              </template>
            </template>
          </table>
        </div>
      </div>
      <div v-show="showLogs" class="backdrop" @click="showLogs = false" v-cloak>

          <h2>Command</h2>
          <pre>{{cmd}}</pre>
          <h2>Output</h2>
          <pre>{{output}}</pre>
        </div>
      </div>
    </div>
